  UNIQUE KEY `course_UQ_autit_id_sid` (`audit_id`,`sId`),
  KEY `sId` (`sId`) USING BTREE,
  CONSTRAINT `course_FK_audit_id` FOREIGN KEY (`audit_id`) REFERENCES `audit_info` (`id`),
  CONSTRAINT `course_FK_stu_id` FOREIGN KEY (`sId`) REFERENCES `student_info` (`student_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=33030 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC;
