INSERT INTO `course_goal` VALUES (1,0,1,' 能运用操作系统的原理描述进程和线程，能分析影响处理调度、磁盘调度、存储器管理、文件管理和输入输出系统的因素，会对比不同解决方案的优缺点，给出结论。 ','能准确运用操作系统的原理描述进程和线程，能准备分析影响处理调度、磁盘调度、存储器管理、文件管理和输入输出系统的因素，能准确对比不同解决方案的优缺点。','能合理运用操作系统的原理描述进程和线程，能分析影响处理调度、磁盘调度、存储器管理、文件管理和输入输出系统的因素，会对比不同解决方案的优缺点。','能较合理运用操作系统的原理描述进程和线程，能分析影响处理调度、磁盘调度、存储器管理、文件管理和输入输出系统的因素，会对比不同解决方案的优缺点。','能运用操作系统的原理描述进程和线程，基本能分析影响处理调度、磁盘调度、存储器管理、文件管理和输入输出系统的因素，基本上会对比不同解决方案的优缺点。','不能分析影响处理调度、磁盘调度、存储器管理、文件管理和输入输出系统的因素，不能对比不同解决方案的优缺点。','2.4','考勤,卷面考试：[第1大题,第2大题,第3大题]',35.00,21.00,6,0.95,'MS1','FX1'),(2,1,1,' 能运用操作系统的原理描述进程和线程，能分析影响处理调度、磁盘调度、存储器管理、文件管理和输入输出系统的因素，会对比不同解决方案的优缺点，给出结论','针对新的用户目标和需求，能系统设计新的处理机调度方案、存储器访问方案、文件分配方案或设备管理方案，能合理分析解决方案在时间上或空间上的开销','针对新的用户目标和需求，能设计合理的处理机调度方案、存储器访问方案、文件分配方案或设备管理方案，能分析解决方案在时间上或空间上的开销','针对新的用户目标和需求，能较合理设计合理的处理机调度方案、存储器访问方案、文件分配方案或设备管理方案，能分析解决方案在时间上或空间上的开销','针对新的用户目标和需求，基本能设计新的处理机调度方案、存储器访问方案、文件分配方案或设备管理方案，基本能分析解决方案在时间上或空间上的开销','不能针对新的用户目标和需求设计新的处理机调度方案、存储器访问方案、文件分配方案或设备管理方案，不能分析解决方案在时间上或空间上的开销','3.3','作业1-6,课堂',20.00,12.00,9,0.92,'MS2','FX2'),(3,2,1,'能分析程序的并发性程度，用前趋图描述程序的并发执行，构建并发系统，能测算不同的调度机制、信号量和同步机制、存储方式和置换算法下的时间和空间的成本。','能准确分析程序的并发性程度，会用前趋图描述程序的并发执行，构建完善的并发系统，能准备测算不同的调度机制、信号量和同步机制、存储方式和置换算法下的时间和空间的成本','能合理分析程序的并发性程度，会用前趋图描述程序的并发执行，构建并发系统，能测算不同的调度机制、信号量和同步机制、存储方式和置换算法下的时间和空间的成本','能较合理分析程序的并发性程度，会用前趋图描述程序的并发执行，构建并发系统，能测算不同的调度机制、信号量和同步机制、存储方式和置换算法下的时间和空间的成本','基本能分析程序的并发性程度，基本会用前趋图描述程序的并发执行，能构建并发系统，基本能测算不同的调度机制、信号量和同步机制、存储方式和置换算法下的时间和空间的成本','无法分析程序的并发性程度，不会用前趋图描述程序的并发执行，不能能测算不同的调度机制、信号量和同步机制、存储方式和置换算法下的时间和空间的成本','4.2','卷面考试：[第4大题]',22.40,13.44,23,0.80,'MS3','FX3'),(4,3,1,'能就具体场景，模拟生产者消费者、磁盘调度、文件管理统或存储器管理的操作流程，设计系统，并能分析、对比不同操作方案的成本和局限性。','就具体场景，能准确模拟生产者消费者、磁盘调度、文件管理统或存储器管理的操作流程，设计系统，能准备分析、对比不同操作方案的成本和局限性','就具体场景，能合理模拟生产者消费者、磁盘调度、文件管理统或存储器管理的操作流程，设计系统，能合理分析、对比不同操作方案的时间和空间成本','就具体场景，能较合理模拟生产者消费者、磁盘调度、文件管理统或存储器管理的操作流程，设计系统，能合理分析、对比不同操作方案的时间和空间成本','就具体场景，基本能模拟生产者消费者、磁盘调度、文件管理统或存储器管理的操作流程，设计系统，能基本分析、对比不同操作方案的成本和局限性','能就具体场景，模拟生产者消费者、磁盘调度、文件管理统或存储器管理的操作流程，设计系统，并能分析、对比不同操作方案的成本和局限性','5.3','作业7-8,卷面考试：[第5大题]'